import 'bootstrap/dist/css/bootstrap.min.css';

const Navbar = () => {
    return (
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <div className="container-fluid">
                <a className="navbar-brand" href="#">ASTA</a>
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
                    <div className="navbar-nav">
                        <a className="nav-link active" aria-current="page" href="#">Nosotros</a>
                        <a className="nav-link active" aria-current="page" href="#">Remeras</a>
                        <a className="nav-link active" aria-current="page" href="#">Tazas</a>
                        <a className="nav-link active" aria-current="page" href="#">Contactanos</a>
                    </div>
                </div>
            </div>
        </nav>
    );

}

export default Navbar;
